## at some point I should build this in; the ability to print shipping labels from ups. here is how to do it in a super simplified manner

require 'rest-client'
require 'base64' 
require 'nokogiri'
shipping_confirm_request_url = "https://wwwcie.ups.com/ups.app/xml/ShipConfirm"

access_request = "
<?xml version=\"1.0\"?>
<AccessRequest xml:lang=\"en-US\">
   <AccessLicenseNumber>xxx</AccessLicenseNumber>
   <UserId>xxx</UserId>
   <Password>xxx</Password>
</AccessRequest>
"

shipping_confirm_request = "
<?xml version=\"1.0\"?>
<ShipmentConfirmRequest xml:lang=\"en-US\">
   <Request>
      <TransactionReference>
         <CustomerContext>ShipConfirmUS</CustomerContext>
         <XpciVersion>1.0001</XpciVersion>
      </TransactionReference>
      <RequestAction>ShipConfirm</RequestAction>
      <RequestOption>nonvalidate</RequestOption>
   </Request>
   <LabelSpecification>
      <LabelPrintMethod>
    <Code>GIF</Code>
    </LabelPrintMethod>
    <LabelImageFormat>
    <Code>GIF</Code> 
    </LabelImageFormat>
      <LabelStockSize>
         <Height>4</Height>
         <Width>6</Width>
      </LabelStockSize>
   </LabelSpecification>
   <Shipment>
      <Shipper>
         <Name>ShipperName</Name>
         <AttentionName>ShipperAttnName</AttentionName>
         <PhoneNumber>5555555555</PhoneNumber>
         <ShipperNumber>1161WA</ShipperNumber>
         <Address>
            <AddressLine1>22 USShipperAddr1</AddressLine1>
            <AddressLine2>USShipperAddr2</AddressLine2>
            <AddressLine3>USShipperAddr3</AddressLine3>
            <City>Plano</City>
            <StateProvinceCode>TX</StateProvinceCode>
            <PostalCode>75093</PostalCode>
            <CountryCode>US</CountryCode>
         </Address>
      </Shipper>
      <ShipTo>
         <CompanyName>ShipToCompanyName</CompanyName>
         <AttentionName>ShipToAttnName</AttentionName>
         <PhoneNumber>5555555555</PhoneNumber>
         <Address>
            <AddressLine1>33 ShipToAddr1</AddressLine1>
            <AddressLine2>USShipToAddr2</AddressLine2>
            <AddressLine3>USShipToAddr3</AddressLine3>
            <City>Atlanta</City>
            <StateProvinceCode>GA</StateProvinceCode>
            <PostalCode>30346</PostalCode>
            <CountryCode>US</CountryCode>
            <ResidentialAddress/>
         </Address>
      </ShipTo>
      <ShipFrom>
         <CompanyName>ShipFromCompanyName</CompanyName>
         <AttentionName>ShipFromAttnName</AttentionName>
         <PhoneNumber>5555555555</PhoneNumber>
         <Address>
            <AddressLine1>22 ShipFromAddr1 St</AddressLine1>
            <AddressLine2>USShipFromAddr2</AddressLine2>
            <AddressLine3>USShipFromAddr3</AddressLine3>
            <City>Athens</City>
            <StateProvinceCode>GA</StateProvinceCode>
            <PostalCode>30605</PostalCode>
            <CountryCode>US</CountryCode>
         </Address>
      </ShipFrom>
      <PaymentInformation>
         <Prepaid>
            <BillShipper>
               <AccountNumber>1161WA</AccountNumber>
            </BillShipper>
         </Prepaid>
      </PaymentInformation>
      <Service>
         <Code>01</Code>
      </Service>
      <Package>
         <Description>Perf Packages</Description>
         <PackagingType>
            <Code>03</Code>
         </PackagingType>
         <PackageWeight>
            <UnitOfMeasurement>
               <Code>LBS</Code>
            </UnitOfMeasurement>
            <Weight>2</Weight>
         </PackageWeight>
      </Package>
      <Package>
         <PackagingType>
            <Code>02</Code>
         </PackagingType>
         <ReferenceNumber>
            <Code>9V</Code>
            <Value>abcdefg</Value>
         </ReferenceNumber>
         <PackageWeight>
            <UnitOfMeasurement>
               <Code>LBS</Code>
            </UnitOfMeasurement>
            <Weight>2</Weight>
         </PackageWeight>
         <PackageServiceOptions>
            <COD>
               <CODFundsCode>8</CODFundsCode>
               <CODCode>3</CODCode>
               <CODAmount>
                  <CurrencyCode>USD</CurrencyCode>
                  <MonetaryValue>1</MonetaryValue>
               </CODAmount>
            </COD>
            <InsuredValue>
               <CurrencyCode>USD</CurrencyCode>
               <MonetaryValue>1</MonetaryValue>
            </InsuredValue>
         </PackageServiceOptions>
      </Package>
   </Shipment>
</ShipmentConfirmRequest>
"

response = RestClient.post shipping_confirm_request_url, access_request+shipping_confirm_request,  :content_type => "text/xml", :accept => "text/xml"
puts shipping_confirm_request_url + response
root = Nokogiri::XML::Document.parse(response)
digest = root.xpath("ShipmentConfirmResponse/ShipmentDigest/text()").to_s

puts digest

shipment_accept_request_url = "https://wwwcie.ups.com/ups.app/xml/ShipAccept"
shipment_accept_request = "
<?xml version=\"1.0\"?>
<ShipmentAcceptRequest>
   <Request>
      <TransactionReference>
         <CustomerContext>TR01</CustomerContext>
         <XpciVersion>1.0001</XpciVersion>
      </TransactionReference>
      <RequestAction>ShipAccept</RequestAction>
      <RequestOption>01</RequestOption>
   </Request>
   <ShipmentDigest>"+digest+"</ShipmentDigest>
</ShipmentAcceptRequest>
"
request = "request" + access_request+shipment_accept_request
puts shipment_accept_request_url + request
response = RestClient.post shipment_accept_request_url, request,  :content_type => "text/xml", :accept => "text/xml"
puts "response" + shipment_accept_request_url + response

root = Nokogiri::XML::Document.parse(response)
image = root.xpath("ShipmentAcceptResponse/ShipmentResults/PackageResults/LabelImage/GraphicImage/text()").to_s
File.open('shipping_label.gif', 'wb') do|f|
  f.write(Base64.decode64(image))
end

